import './Service.css';
import axios from 'axios';
import Board_header from "./../Board_header/Board_header";
import Title from './../Title/Title';
import Board_list from "./../Board_list/Board_list.js";
import {React, useState} from "react";
function Service_Total(){
    const [content, setContent] = useState('');
    window.onload = axios({
        method: "get",
        url: "http://54.180.210.232/api/v1/services/all",
        headers: {
            "Content-Type": "application/json",
            Authorization: "Bearer eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJleGFtcGxlQGV4YW1wbGUuY29tIiwiYXV0aCI6IlJPTEVfQ0xBU1NJQyIsImV4cCI6MTY3MTg2MTQyNn0.ojz7tq4j1o-EF226io_p22TQ5BQ_8OVBFZ2NAw37zNCcABKQqr8u8JU_MzOgeI05nD8CxiNgkXDVx610NZTCfQ"
        },
    }).then((res) => {
        // console.log(res.data.message);
        // console.log(res.data.result);
        setContent(res.data.result);
        console.log(content);
    }).catch((error) => {
        alert("정보를 가져올 수 없습니다");
    });
    return(
        <div className="Service_Top_Wrap">
            <Title title="전체 서비스" />
            <Board_header t1="번호" t2="제목" t3="글쓴이" t4="신청일"/>
            <ul>
                {content===Object(content)
                    ? content.content.map((content, index) => (
                        <li key={index}>
                            <Board_list num={index+1} title={content.title} name={content[index].bookingStatus} />
                        </li>
                    ))
                    : "등록된 글이 없습니다"}
            </ul>
        </div>
    );
}

export default Service_Total;
